import * as types from './../constants/ActionTypes';

var initialState = [
    {
        id : 1,
        name : 'IP7',
        image : '',
        description : "Apple's",
        price : 800,
        inventory : 10
    }
];

const product = (state = initialState, action) => {
    switch(action.type){
        default : return state;
    }
}

export default product;
